export default function CashPayment(props) {
    return(
        <div className="CashPayment">
            <div className="payment in">{"Bar-Einzahlung: "} <NumberInput value={props.in} setValue={props.setIn} /></div>
            <div>{"Bar-Auszahlung: "} <NumberInput value={props.out} setValue={props.setOut} /></div>
        </div>
    );
}
